import React from 'react';
import MenuIcon from '@material-ui/icons/Menu';
import { AppBar, Toolbar, Button, IconButton, Typography, createMuiTheme, Box, InputBase } from '@material-ui/core';
import {makeStyles} from '@material-ui/core/styles';
import SearchIcon from '@material-ui/icons/Search';

const useStyles = makeStyles({
    Header: {
        backgroundColor: "#20B2AA",
        justifyContent: 'center',
    }
})

const Header = () => {
    const classes = useStyles();
    return(
        <>
            <AppBar className={classes.Header} position='static'>
                <Toolbar>
                    <IconButton edge='start'>
                        <MenuIcon/>
                    </IconButton>
                    <Box ml={3} mr={4}>
                        <Typography variant='h6'> MyCookBook </Typography>
                    </Box>
                    <Typography edge='end'>
                        <Box bgcolor="#fff" boxShadow={5} mx='auto' borderRadius='10px' py={0} pr={10}>
                            <IconButton>
                                <SearchIcon/>
                            </IconButton>
                            <InputBase placeholder='Search...'/>
                        </Box>
                    </Typography>
                </Toolbar>
            </AppBar>
        </>
    )
}

export default Header;
